export function insertValue(trie, keys, value, index = 0) {
    if (trie === undefined) {
        trie = {
            values: new Map(),
            value: undefined,
        };
    }
    if (keys.length === index) {
        trie.value = value;
    }
    else {
        trie.values.set(keys[index], insertValue(trie.values.get(keys[index]), keys, value, index + 1));
    }
    return trie;
}
export function getNodeByKeys(trie, keys) {
    let i = 0;
    while (trie !== undefined && i < keys.length) {
        trie = trie.values.get(keys[i++]);
    }
    return trie;
}
export function getValueByKeys(trie, keys) {
    return getNodeByKeys(trie, keys)?.value;
}
